<script type="text/javascript">
var n = 15;
var idx = 0;
var timer = 0;
var next = ""

function driver(timer, trace) {
	var t = trace[idx];
	//console.log("idx=%o, t=%o", idx, t);
	if (next != "") {
		console.log("%o: prev op=%o", idx, next);
		op = next
	} else {
		console.log("%o: next op=%o", idx, t.op);
		op = t.op
	}
	switch (op) {
	case "I":
		insert(t.t, t.b, t.s)
		setText(t.t, t.b, t.s, t.v.toString());
		next = "UI"
		break;
	case "E":
		evict(t.t, t.b, t.s)
		setText(t.t, t.b, t.s, "");
		next = "UE"
		break;
	case "P":
		probe(t.t, t.b, t.s)
		next = "UP"
		break;
	case "UI":
		uninsert(t.t, t.b, t.s)
		next = ""
		break;
	case "UE":
		unevict(t.t, t.b, t.s)
		next = ""
		break;
	case "UP":
		unprobe(t.t, t.b, t.s)
		next = ""
		break;
	case "H":
		hilite(t.t, t.b, t.s);
		next = ""
		break;
	case "U":
		unhilite(t.t, t.b, t.s);
		next = ""
		break;
	}
	for (;;) {
		if (next.length == 2) {
			break;
		}
		if (++idx >= trace.length) {
	    	clearInterval(timer);
	    	return
	    }
		t = trace[idx];
		break;
	    if (t.op == "U") {
			console.log("clear: idx=%o, t=%o", idx, t);
			unhilite(t.t, t.b, t.s);
	    } else {
	    	break
	    }
	}	
}

function unprobe(t, b, s) {

function sleep(ms){
    var now = new Date().getTime();

	//console.log("id=%o, text=%o", id, text);
    //document.getElementById(b).innerHTML = text;
    document.getElementById("tab").rows[b+1].cells[t+1].innerHTML = text
}

function clearText (t, b, s) {
    //document.getElementById(id).innerHTML = '';
	document.getElementById("tab").rows[b+1].cells[t+1].innerHTML = ""
}
